import React from 'react';
import Image from 'react-bootstrap/Image'
import me from './picture.JPG'
import './Picture.css'


class Pic extends React.Component {
  render() {
    return (
      <div className="picture text-align-center">
        <Image src={me} alt="picture of me" fluid />
        <div className="intro m-0">
          <h1 className="mt-0 mb-0 ml-2 mr-2">陈芳婷</h1>
          <h1 className="mt-0 mb-0 ml-2 mr-2">Fangting Chen</h1>
          <h3 className="mt-0 ml-2 mr-2">I'm in my final year of Univerisity of Alberta 
          </h3>
        </div>
      </div>
    );

    }
}

export default Pic;
